import React from 'react'
import placeholder from '.././Img/placeholder.jpg'
import './Onas.css'


const Onas = () => {
  return (
    <div className='onasmian' >
    <img className='placeholder' src={placeholder} />
    
    </div>
  )
}

export default Onas
